import "./App.css";
import Head from "./components/Head";
import Body from "./components/Body";
import Footer from "./components/Footer";
import "./css/styles.css";
import React from "react";
import WebServices from "./components/Body/Web-services";

function App() {
  return (
    <div className="App">
      <WebServices />

      <Head />
      <Body />
      <Footer />
    </div>
  );
}

export default App;
